import React, { Fragment } from "react";
import FrontBanner from '../UI/FrontBanner/FrontBanner'
import Products from '../Components/Products/Products'

const App = () => {
  return (
    <Fragment>
      <FrontBanner />
      <Products />
      <img src="NavigationItems/About/about.jpg" alt="banner logo" alt=""/>
    </Fragment>
  );
};



export default App;
